/* 69 */
/***/function (module, exports) {

	module.exports = "<h3 id=\"where-when-how-\">Where, when, how?</h3>\n<p>UofT BioHacks 2018 will take place on March 17th-18th, 2018. It will be a two day\nevent hosted in University College. Registration opens February 16th 2018!</p>\n<h3 id=\"what-is-the-theme-of-uoft-biohacks-2018-\">What is the theme of UofT BioHacks 2018?</h3>\n<p>Rethinking Genome Annotation.</p>\n<h3 id=\"will-this-event-run-overnight-\">Will this event run overnight?</h3>\n<p>We will release details for this later. Likely YES!</p>\n<h3 id=\"does-registration-guarantee-a-space-at-uoft-biohacks-2018-\">Does registration guarantee a space at UofT BioHacks 2018?</h3>\n<p>Due to the high demand and limited space, registration does not guarantee a\nspot in the competitions. Selected candidates will recieve an invitation email.\nCandidates who accept the invitations will be guaranteed for a spot in the\ncompetition. Priority will be given to members who have detailed registration\nforms. If you don&#39;t get a spot right away, we&#39;ll put you on the waitlist and\nlet you know if something opens up!</p>\n<h3 id=\"how-much-coding-or-biology-background-do-i-need-\">How much coding or biology background do I need?</h3>\n<p>We do not expect an advanced bioinformatics background. However, this hackathon\nis not for first time coders. Teams are encouraged to have members with\ndifferent backgrounds who work together. Additionally, there will be workshops\nprovided to improve your bioinformatics skills. To gauge your bioinformatics\ncomfort, try a few problems at\n<a href=\"http://rosalind.info/problems/locations/\">Rosalind</a>. The &quot;Bioinformatics\nStronghold&quot; should not be out of reach for you.</p>\n<h3 id=\"how-do-i-form-a-team-\">How do I form a team?</h3>\n<p>In order to join a team, you can</p>\n<ol>\n<li>Create a team and invite your friends by using their UserIDs or email addresses.</li>\n<li>OR You can contact your friend and ask to be invited to their team.</li>\n<li>OR Show up the day of and find others who need a team!!</li>\n</ol>\n<p>Note: You cannot send an invitation to a friend who is already on a team.</p>\n<h3 id=\"i-don-t-have-a-team-should-i-still-register-\">I dont have a team, should I still register?</h3>\n<p>Definitely! We will help you find your team members.</p>\n<h3 id=\"how-many-members-per-team-\">How many members per team?</h3>\n<p>Up to 4 members per team</p>\n<h3 id=\"what-you-should-bring-\">What you should bring?</h3>\n<p>A laptop, charger and yourself!</p>\n<h3 id=\"will-there-be-hardware-medical-devices-or-gadgets-provided-\">Will there be hardware (medical devices or gadgets) provided?</h3>\n<p>Nope! We will not provide any hardware.</p>\n<h3 id=\"is-there-any-preparation-i-can-do-to-before-\">Is there any preparation I can do to before?</h3>\n<p>1) Read up! Google around or check out some of our provided links.</p>\n<p>2) Brainstorm ideas with your team!</p>\n<p>3) Brush up on your coding skills</p>\n<h3 id=\"will-there-be-food-\">Will there be food?</h3>\n<p>Yes, refreshments and food will be provided.</p>\n<h3 id=\"are-there-any-prizes-awarded-\">Are there any prizes awarded?</h3>\n<p>Yes! Prizes will be awarded for the different challanges based on submissions\nand presentations so put your best foot forward!!</p>\n<h3 id=\"are-there-language-constraints-\">Are there language constraints?</h3>\n<p>Code your submission however you&#39;re comfortable, but keep in mind that you\nmight encounter large volumes of data. For this reason we often recommend\npython or R.</p>\n<h3 id=\"my-questions-is-infrequently-asked-\">My questions is infrequently asked!</h3>\n<p>If you&#39;ve got lingering Q&#39;s we have A&#39;s! Shoot us an email at\nBCBbiohacks2018@gmail.com and we&#39;ll be happy to help you out.</p>\n";

