	module.exports = "<h1 id=\"bioinformatics-and-computational-biology-cssu-presents-bcb-biohacks-2018\">Bioinformatics and Computational Biology + CSSU Presents: BCB BioHacks 2018</h1>\n<p>Returning for its 2nd year at UofT, BioHacks is a two day hackathon that will\nfeature academic speakers, workshops, and industry guests. We can&#39;t wait to\nwelcome a hundred undergraduate participants to learn, build, and share their\nsolutions to current challenges in bioinformatics.</p>\n<p>Bioinformatics is a classic interdisciplinary field. At BioHacks2018, we&#39;re\nlooking to bring computer scicene and life science students together to problem\nsolve and apply domain knowledge. In addition, we want to expose our students\nto some of the fascinating research and industry oportunities local to Toronto.</p>\n<p>We&#39;re inspiring each other to excel in bioinformatics learning, and invite you\nto join us in pioneering the field!</p>\n";

