	module.exports = "<h1 id=\"challenges\">Challenges</h1>\n<h2 id=\"1-rethinking-genome-annotation\">1. Rethinking Genome Annotation</h2>\n<p>Nearly 20 years since the conclusion of the <a href=\"https://www.genome.gov/10001772/all-about-the--human-genome-project-hgp/\">human genome\nproject</a>,\nwe know a lot more about gene function than we once did. For tens of thousands\nof genes, this amounts to a huge volume of information. How can we improve on\nhow we associate the existing information for a gene? Consider a gene&#39;s\nsequence, function, regulation, pathways it participates in, and its associated\nprotein(s).</p>\n<p>Gene annotation and prediction is a process where a gene function or family is\npredicted from reading a nucleotide or amino acid sequence. This process is one\nof the most important steps in studying the metabolism, phylogeny, and the\noverall genomic properties of a sequenced species.</p>\n<p>With the emergence of high throughput sequencing technologies, development of\nautomated gene annotation methods has exploded, creating significantly more\nprecise and efficient algorithms. Existing tools use a variety of approaches\nsuch as sequence alignment, artificial neural networks and statistical modeling\nto name a few. Your challenge is to develop a novel method for gene prediction,\nor construct a pipeline that uses a combination of existing approaches to\nimprove gene annotation.</p>\n<h5 id=\"tools\">Tools</h5>\n<ul>\n<li><a href=\"http://blast.ncbi.nlm.nih.gov/Blast.cgi\">BLAST</a></li>\n<li><a href=\"http://geneontology.org/\">Gene Ontology Consortium</a></li>\n<li><a href=\"http://toolkit.tuebingen.mpg.de/hhpred\">HHpred</a></li>\n<li><a href=\"http://pfam.xfam.org/\">Pfam</a></li>\n<li><a href=\"http://www.cbcb.umd.edu/software/glimmer-mg/\">GLIMMER</a></li>\n<li><a href=\"https://string-db.org/\">STRING</a></li>\n<li><a href=\"https://www.rcsb.org/\">PDB</a></li>\n<li><a href=\"https://genome.ucsc.edu/\">UCSC genome browser</a></li>\n</